export const Uploadproduct = (state, val) => {
    console.log('sirve evento', val)

    state.products.productsDescription = val

}




export const increment = (state) => {
    state.count++
    state.lastMutation = 'Increment'
}


export const incrementBy = (state, val) => {
    state.count += val
    state.lastMutation = 'IncrementBy' + val
    state.lastRandomInt = val
}


export const setLoading = (state, val) => {
    state.isLoading = val
    state.lastMutation = 'setLoading' + val
}


